function calcular(){try{var a=parseFloat(document.getElementById("Cantidad").value)||0,e=parseFloat(document.getElementById("Precios").value)||0;document.getElementById("PrecioTotal").value=a*e}catch(a){}}function actualizarCalcular(){try{var a=parseFloat(document.getElementById("actualizarCantidad").value)||0,e=parseFloat(document.getElementById("actualizarPrecios").value)||0;document.getElementById("actualizarPrecioTotal").value=a*e}catch(a){}}function limpiarNumero(a){a.value=a.value.replace(/\D/g,"")}